import React from 'react';

const Lang = () => {
    return (
        <div>
            <div className="body">
                <br/>
                <div className="box">
                    <input type="text" placeholder="Your Text Here..." required autocomplete="off"/><br/>
                    <button type="submit">Find</button>
                </div>
            </div>
        </div>
    )
}

export default Lang;
